import logo from './logo.svg';
import {useState} from "react";
import './App.css';
import "./App.scss";

const App = () => {
  const [menuOpen, toggleMenu] = useState(false);
  return (
    <div className="App">
        <input id="hamburger"
          type="checkbox"
          checked={menuOpen}
          onClick={() => {
            menuOpen? toggleMenu(false): toggleMenu(true);
          }}
        />
        <label for="hamburger">
          <div />
          <div class="top" />
          <div class="bottom" />
        </label>
        <div id="menu">
          <ul>
          <li>one</li>
          <li>one</li>
          <li>one</li>
          <li>one</li>
          </ul>
        </div>
        {menuOpen? "opened": "closed"}
    </div>
  );
}

export default App;
